package ai.whylabs.dataservice.services;

import static org.hamcrest.MatcherAssert.assertThat;
import static org.hamcrest.Matchers.closeTo;
import static org.junit.jupiter.api.Assertions.*;

import ai.whylabs.dataservice.responses.ClassificationSummaryRow;
import com.shaded.whylabs.com.google.protobuf.InvalidProtocolBufferException;
import java.util.Map;
import org.junit.jupiter.api.Test;

class ClassificationMetricsTest {
  @Test
  public void UniformCDF() {
    // test pathological case of repeated single-value performance metrics.
    // This can cause exceptions when extracting CDF from sketches if not handled correctly.
    Map<String, Long> columns =
        Map.of("predictionField", 10L, "targetField", 10L, "scoreField", 10L);
    final com.whylogs.core.metrics.ClassificationMetrics whyCM =
        new com.whylogs.core.metrics.ClassificationMetrics(
            "predictionField", "targetField", "scoreField");
    whyCM.track(columns);
    whyCM.track(columns);
    whyCM.track(columns);
    whyCM.track(columns);

    final ClassificationMetrics dsCM = new ClassificationMetrics(whyCM);
    // assert does not throw any exception, particularly
    // SketchesArgumentException: Values must be unique and monotonically increasing
    assertDoesNotThrow(() -> dsCM.toSummaryRowBuilder(0L));
  }

  @Test
  public void CustomerMetrics() throws InvalidProtocolBufferException {
    // example of problematic customer classification metrics
    String txt =
        "";
    final ClassificationMetrics cm = ClassificationMetrics.fromProtobuf(txt.getBytes());
    final ClassificationSummaryRow summary = cm.toSummaryRowBuilder(0L);
    // Due to bug, metric was not fully accounting for values < 0, ROC curve was cut off at the high
    // end.
    // assert that the last ROC value is high-and-to-the-right on the graph.
    assertThat(summary.getAucroc(), closeTo(0.6927487902330315, 0.01));
    assertThat(summary.getRoc()[99][0], closeTo(0.909382518043304, 0.01));
    assertThat(summary.getRoc()[99][1], closeTo(0.9800478850758181, 0.01));
  }
}
